module.exports = {
	"develop your own playground": "{\"title\":\"develop your own playground\",\"description\":\"基础教程\",\"author\":\"imink\",\"url\":\"develop-your-own-playground\",\"toc\":[],\"content\":\"<h3 id=\\\"this-is-basic-tutorial\\\">this is basic tutorial</h3>\\n\"}",
	"Get started": "{\"title\":\"Get started\",\"description\":\"基础教程\",\"author\":\"imink\",\"url\":\"get-started\",\"toc\":[],\"content\":\"<h3 id=\\\"this-is-basic-tutorial\\\">this is basic tutorial</h3>\\n\"}",
	"5个 Demo 功能展示": "{\"title\":\"5个 Demo 功能展示\",\"description\":\"针对 cicada.js 的擅长场景，我们制作了5个 demo 用来展示场景的应用，方便用户把玩代码\",\"author\":\"imink\",\"url\":\"5个-demo-功能展示\",\"toc\":[],\"content\":\"<h1 id=\\\"5-ge4-demo-gong1-neng2-zhan3-shi4\\\">5个 Demo 功能展示</h1>\\n<p>我们针对 cicada.js 的擅长场景，提供了5个 demo \\b供用户使用，方便理解。</p>\\n<ul>\\n<li><a href=\\\"\\\">Todo</a> Todo</li>\\n<li><a href=\\\"\\\">Counter</a> 一个打点器</li>\\n<li><a href=\\\"\\\">Basic</a> 标准的 Hello World</li>\\n<li><a href=\\\"\\\">\\bDynamic Render</a> 通过声明式的方式动态添加子组件</li>\\n<li><a href=\\\"\\\">Form</a> 标准的表单页面，几乎涵盖了常见的表单验证的所有场景，包括非空校验，联合校验，异步校验，显影用法</li>\\n<li><a href=\\\"\\\">Fragment</a></li>\\n<li><a href=\\\"\\\">Preview</a></li>\\n<li><a href=\\\"\\\">React-router</a> 路由用法，可以配合 react-router-dom 实现路由功能</li>\\n<li><a href=\\\"\\\">RepeatInFrom</a></li>\\n<li><a href=\\\"\\\">Step</a></li>\\n</ul>\\n\"}",
	"background": "{\"title\":\"background\",\"author\":\"imink\",\"index\":[1,4],\"group\":\"HOW IT WORKS\",\"url\":\"background\",\"toc\":[],\"content\":\"<h3 id=\\\"gai4-lan3\\\">概览</h3>\\n<p>金蝉项目本身是为了方便非前端工程师设计中台页面而诞生的。所以我们设计了一套 Online IDE 系统来方便开发者的通过组件的方式构建页面。在 React 的基础上，我们设计了一套框架 Cicada Engine 来完成对 IDE 的渲染，背后原理是用声明式的方式来完成组件和页面的创建，然后通过 Cicada Engine 完成渲染操作，包括了监听事件的注入。</p>\\n\"}",
	"什么是 cicada.js": "{\"title\":\"什么是 cicada.js\",\"description\":\"Nothing to see here\",\"group\":\"HOW IT WORKS\",\"index\":[1,1],\"url\":\"什么是-cicada.js\",\"toc\":[{\"id\":\"sub-heading-1\",\"value\":\"Sub heading 1\"},{\"id\":\"sub-heading-2\",\"value\":\"Sub heading 2\"}],\"content\":\"<h1 id=\\\"heading\\\">Heading</h1>\\n<h2 id=\\\"sub-heading-1\\\">Sub heading 1</h2>\\n<p>Some nice text</p>\\n<h2 id=\\\"sub-heading-2\\\">Sub heading 2</h2>\\n<p>Some even nicer text</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-literal\\\">true</span>) {\\n  <span class=\\\"hljs-built_in\\\">console</span>.log(<span class=\\\"hljs-string\\\">'Yes I can!'</span>)\\n}\\n</code></pre>\\n\"}",
	"React lego 组件规范": "{\"title\":\"React lego 组件规范\",\"description\":\"react lego specification\",\"author\":\"imink\",\"group\":\"HOW IT WORKS\",\"index\":[0,2],\"url\":\"react-lego-组件规范\",\"toc\":[{\"id\":\"shi3-yong4\",\"value\":\"使用\"},{\"id\":\"gui1-ze2\",\"value\":\"规则\"},{\"id\":\"license\",\"value\":\"License\"}],\"content\":\"<h1 id=\\\"react-lego\\\">react-lego</h1>\\n<p>一种特别注重扩展和复用的 React 组件编写规则。</p>\\n<h2 id=\\\"shi3-yong4\\\">使用</h2>\\n<p>仓库中提供了 examples。可直接通过以下命令启动查看:</p>\\n<pre><code>npm install\\nnpm start\\n// visit <span class=\\\"hljs-number\\\">127.0</span><span class=\\\"hljs-meta\\\">.0</span><span class=\\\"hljs-meta\\\">.1</span>/examples/basic 或者 <span class=\\\"hljs-number\\\">127.0</span><span class=\\\"hljs-meta\\\">.0</span><span class=\\\"hljs-meta\\\">.1</span>/examples/wrapper\\n</code></pre>\\n<p>仓库中提供的 wrap 函数可以直接将 react-lego 组件打包成普通 react 组件进行使用。使用方法参考 example 中的代码。</p>\\n<h2 id=\\\"gui1-ze2\\\">规则</h2>\\n<h3 id=\\\"gai4-lan3\\\">概览</h3>\\n<p>react-lego(以下简称 lego) 相比于传统的 react 组件，最主要的差别在于: 直接将组件的 state, listener, render 暴露到外部，由外部框架负责创建成 React 组件。一个典型的 lego 组件例子:</p>\\n<pre class=\\\"hljs\\\"><code>  <span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> defaultStateTypes = {<span class=\\\"hljs-comment\\\">/* state 的类型声明 */</span>}\\n\\n  <span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> defaultState = {<span class=\\\"hljs-comment\\\">/* 默认的 state */</span>}\\n\\n  <span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">initialize</span>(<span class=\\\"hljs-params\\\"></span>) </span>{\\n    <span class=\\\"hljs-comment\\\">// 返回一个对象，改对象将作为 instance 参数注入到所有函数中。可将 instance 作为数据缓存</span>\\n    <span class=\\\"hljs-keyword\\\">return</span> {}\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> interceptors = [<span class=\\\"hljs-comment\\\">/* 声明外部传入的函数类型的属性 */</span>]\\n\\n  <span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> defaultListeners = {\\n    <span class=\\\"hljs-comment\\\">// 第一参数为外部框架注入。后面的参数即调用 listener 时传入的参数。</span>\\n    onClick({ state, instance }, ...args) {\\n      <span class=\\\"hljs-comment\\\">// const changedStateValues = ...</span>\\n      <span class=\\\"hljs-comment\\\">// changedStateValues 只包含变化了的 state 字段</span>\\n      <span class=\\\"hljs-keyword\\\">return</span> changedStateValues\\n    }\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">export</span> defaultWrappers = {\\n    <span class=\\\"hljs-comment\\\">// 可由外部传入的语义化的子组件</span>\\n    Text: <span class=\\\"hljs-string\\\">'span'</span>\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> identifiers = {\\n    <span class=\\\"hljs-comment\\\">// 例如 Tabs 下的 TabPane。Input 的 Prefix 这种占位符式的组件需要在这里声明</span>\\n  }\\n\\n  <span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">render</span>(<span class=\\\"hljs-params\\\">{state, children, instance, listeners, wrappers, interceptors}</span>) </span>{\\n    <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">div</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">div</span>&gt;</span></span>\\n  }\\n</code></pre>\\n<h3 id=\\\"defaultstatetypes\\\">defaultStateTypes</h3>\\n<p>声明的方式和 react 的 defaultPropTypes 一样。可以直接使用 <code>prop-types</code> 来声明。例如:</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> defaultStateTypes = {\\n  <span class=\\\"hljs-attr\\\">value</span>: PropTypes.string.isRequired\\n}\\n</code></pre>\\n<h3 id=\\\"defaultstate\\\">defaultState</h3>\\n<p>在 lego 中不再区别 state 和 props，所有会影响到组件渲染的数据，都应该写成 state。state 即可由内部 listener 修改，也可由外部传入。在设计 state 时，应该遵循一下原则:</p>\\n<ul>\\n<li>state 的各个值之间尽量不要存在依赖关系。如果存在，应该拆成更原子的多个值。或者合并成一个值。</li>\\n<li>优化性能的缓存数据应该存在 instance 上。</li>\\n</ul>\\n<p>注意，state 中不应该包含函数，要由外部传如的函数应该使用 interceptors。</p>\\n<h3 id=\\\"initialize\\\">initialize</h3>\\n<p>组件初始化时调用，放回的对象会贯穿组件的整个生命周期。可以在对象上存放缓存数据。</p>\\n<h3 id=\\\"interceptors\\\">interceptors</h3>\\n<p>当组件需要获取外部传入函数，并且根据函数的返回值再进行渲染或者运算时，应该声明需要的 interceptors 的名字。例如 Upload 组件通常会一个 <code>beforeUpload</code> 函数来判断是否要上传。那么再组件中就应该声明:</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> interceptors = [<span class=\\\"hljs-string\\\">'beforeUpload'</span>]\\n</code></pre>\\n<h3 id=\\\"defaultlisteners\\\">defaultListeners</h3>\\n<p>组件默认的 state 处理函数。参数的第一参数是由外部注入的，一定会包含 state/instance 两个值。剩下的参数即是调用 listener 是传入的参数。返回值应该是变化的 state 键值对。注意，listener 应该为纯函数，其中不应该有 ajax 和其他副作用。例如 Input:</p>\\n<pre class=\\\"hljs\\\"><code> <span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> listeners = {\\n   onChange(_, e) {\\n     <span class=\\\"hljs-keyword\\\">return</span> {  <span class=\\\"hljs-attr\\\">value</span>: e.target.value }\\n   }\\n }\\n\\n <span class=\\\"hljs-keyword\\\">export</span> render({state, listeners}) {\\n   <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">input</span> <span class=\\\"hljs-attr\\\">value</span>=<span class=\\\"hljs-string\\\">{state.value}</span> <span class=\\\"hljs-attr\\\">onChange</span>=<span class=\\\"hljs-string\\\">{listeners.onChange}</span> /&gt;</span>\\n }\\n</span></code></pre>\\n<h3 id=\\\"defaultwrappers\\\">defaultWrappers</h3>\\n<p>组件用来包装自身内容的语义化的标签。可以用来做外部样式的复写，或者多语言支持等。声明的 wrapper 必须是一个标准的 react 组件。以一个简单的文字展示组件为例:</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">export</span> defaultWrappers = {\\n  <span class=\\\"hljs-attr\\\">Text</span>: <span class=\\\"hljs-string\\\">'span'</span>\\n}\\n\\n<span class=\\\"hljs-keyword\\\">export</span> render({ state, wrappers }) {\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">div</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Text</span>&gt;</span>name: <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Text</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">input</span> <span class=\\\"hljs-attr\\\">value</span>=<span class=\\\"hljs-string\\\">{state.name}/</span>&gt;</span><span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">div</span>&gt;</span>\\n}\\n</span></code></pre>\\n<p>在传统的组件库中，要支持样式的复写，通常是与外部约定 className。要支持多语言通常是在组件内判断外部是否有要传入复写的文字。而通过这种方式，外部框架就能通过传入定制的 Wrapper 来覆盖掉默认的样式甚至文字内容。同时又不需要组件内部了解具体的方案，也不需要繁琐的判断。</p>\\n<h3 id=\\\"identifiers\\\">identifiers</h3>\\n<p>很多组件都需要对外部传入的子组件进行位置的调整，或者根据数据来进行复制。例如 Tabs，通常会把内容包装在 Tabs.TabPane 中。在 lego 中统一将这样的内容包装在声明的 identifier 中。例如 Tabs:</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> identifiers = {\\n  Pane() { <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-literal\\\">null</span> }\\n}\\n\\n<span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">const</span> render({ state, identifiers, children }) = {\\n  <span class=\\\"hljs-keyword\\\">const</span> paneChildren = children.find(<span class=\\\"hljs-function\\\"><span class=\\\"hljs-params\\\">child</span> =&gt;</span> child.type.__base === identifiers.Pane)\\n  <span class=\\\"hljs-keyword\\\">const</span> panes = state.list.map(<span class=\\\"hljs-comment\\\">/*根据数据复制 pane*/</span>)\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">div</span>&gt;</span>{panes}<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">div</span>&gt;</span></span>\\n}\\n</code></pre>\\n<h3 id=\\\"render\\\">render</h3>\\n<p>与 react 的 render 函数不同的是，lego 的 render 是个纯函数。它的第一参数应该包含 <code>state children instance listeners wrappers interceptors</code>。</p>\\n<h2 id=\\\"license\\\">License</h2>\\n<p>MIT</p>\\n\"}",
	"state tree design": "{\"title\":\"state tree design\",\"description\":\"基础教程\",\"author\":\"imink\",\"index\":[1,3],\"group\":\"HOW IT WORKS\",\"url\":\"state-tree-design\",\"toc\":[],\"content\":\"<p>os-cicada-engine src 下的入口文件是 <strong>Render.js</strong>。Render 类似 Provider 把自己的 props 放进 context 中传递给 child component，除此之外，createFlatTree 把声明式的组件用递归的方式依次展现出来。在 componentDidMount 的时候，background 下的 utility 会被激活（demo中 只有 validation 有 start() 方法）。</p>\\n<p><strong>createConnect.js</strong> 类似 Redux 的 connect，但是要做的事情更多，除了把声明式组件的配置数据按照React 的方式获取和配置外，主要完成了下面4个初始化操作：</p>\\n<ul>\\n<li>setupLifeCycle</li>\\n<li>setupListeners</li>\\n<li>setupInterceptors</li>\\n<li>registerToContext</li>\\n</ul>\\n<p><strong>setupLifeCycle</strong> 重新定义了几个 render 的规则，比如</p>\\n<pre class=\\\"hljs\\\"><code>shouldComponentUpdate(nextProps, nextState) {\\n<span class=\\\"hljs-comment\\\">// CAUTION 这里表示不接受父组件render，只订阅数据源的改变，即父组件 render，子组件默认不 render</span>\\n  <span class=\\\"hljs-keyword\\\">return</span> <span class=\\\"hljs-keyword\\\">this</span>.state.stateChange !== nextState.stateChange\\n}\\n</code></pre>\\n<p>以及在组件销毁的时候，清空相关变量和监听函数</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-comment\\\">// 销毁相关 listeners 和 register，还有 background</span>\\ncomponentWillUnMount() {\\n  <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">typeof</span> <span class=\\\"hljs-keyword\\\">this</span>.unRegisterStateTree === <span class=\\\"hljs-string\\\">'function'</span>) { <span class=\\\"hljs-keyword\\\">this</span>.unRegisterStateTree() }\\n  <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">typeof</span> <span class=\\\"hljs-keyword\\\">this</span>.unsubscribeStateTree === <span class=\\\"hljs-string\\\">'function'</span>) { <span class=\\\"hljs-keyword\\\">this</span>.unsubscribeStateTree() }\\n  <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">typeof</span> <span class=\\\"hljs-keyword\\\">this</span>.unsubscribeAppearance === <span class=\\\"hljs-string\\\">'function'</span>) { <span class=\\\"hljs-keyword\\\">this</span>.unsubscribeAppearance() }\\n  <span class=\\\"hljs-keyword\\\">if</span> (<span class=\\\"hljs-keyword\\\">typeof</span> <span class=\\\"hljs-keyword\\\">this</span>.cancelBackground === <span class=\\\"hljs-string\\\">'function'</span>) { <span class=\\\"hljs-keyword\\\">this</span>.cancelBackground() }}\\n</code></pre>\\n<p><strong>setupListeners</strong> 和 <strong>setupInterceptors</strong> 类似，把用户自定义的listenners 和默认的监听事件或者 interceptor 合并，注入到 context 当中。这里的 connect 更像一个 warpper 或者胶水组件，使用者只需要在声明组件的时候，按照一定规则声明监听事件和其他属性或者方法，就可以配合 background 完成一些自动运行的效果，比如用户定义了显影规则，那么在 background 当中的 appearance 就可以根据用户写的事件去触发 div 显影。前提是我们把 background 暴露在了 context 当中，connect wrapper过的组件本身是不关注是否存在对应的 background，接下来我们需要深入到 background 当中，了解他们如何配合这些 wrapper 过的组件，来实现一些自动运行（autorun）的效果</p>\\n<p><strong>registerToContext</strong> 在当前组件的 context 当中，提供了一些基本属性，比如 stateId, 同时提供了注销或者清空 subscriber 的方法供组件在 componentWillUnMount 的时候调用。避免不需要的监听事件依然存在。</p>\\n<p>在了解 background 之前，先看下和组件对应的状态树 stateTree 。它们之间的关系通过 state id 来一一对应，即 component 通过 stateTree(stateId) 来找到对应的组件状态。\\ncreateStateTree 初始化全局的 stateTree, 暴露了一些常用方法来操作 state，比如 set()、mergeById()，setById()。\\n关于 stateTree 的 publish 和 subscribe 定义在了 <strong>applyStateTreeSubscriber.js</strong> 文件里。\\n所以在应用的入口文件中有一句：</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-comment\\\">// 高阶函数写法，createStateTree 返回值作为 applyStateTreeSubscriber，并且执行</span>\\n<span class=\\\"hljs-keyword\\\">const</span> stateTree = applyStateTreeSubscriber(createStateTree)()\\n</code></pre>\\n<p>和一般的 subscriber 写法有所区别的是，applyStateTreeSubscriber 当中存在一个 globalSubscriber 来监听 Background 相关事件，比如 validation 有关的依赖或者事件。对于一般事件（和 background 有关，用户自定义），通过 <code>subscribeByStateId(stateId, fn)</code> 来订阅，stateTree 维护了一个 globalSubscriber （不需要 stateId）用来针对 mapBackgroundToState 和 visible 的依赖调用。每次 stateTree 发生 set 相关操作的时候，比如 set，merge 都会根据 stateId 找到所有的监听事件并且触发 notify() 。至于这些监听事件是如何收集的？ 在 createConnect 当中，有</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">this</span>.unsubscribeStateTree = stateTree.subscribeByStateId(stateId, ::<span class=\\\"hljs-keyword\\\">this</span>.subscribe)\\n</code></pre>\\n<p>来完成针对某个组件的依赖收集</p>\\n<p>既然 background 是提供给用户的来简化 stateTree 操作的机制，background 是如何把 job, utility 这些类插件的代码和用户写的胶水代码（connect）结合起来的？先从 <strong>createBackgroung</strong> 入手，</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">export</span> <span class=\\\"hljs-keyword\\\">default</span> <span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">createBackground</span>(<span class=\\\"hljs-params\\\">backgroundDef = {}, stateTree, appearance</span>)</span>{}\\n</code></pre>\\n<p>它接受三个参数，其中 backgroundDef 包含了 job 和 utility，appearance 用来处理和 UI 展示的操作比如显影，同时 createBackgroung 返回一个 register 方法，用来在 createConnect 中注册，也就是把来自 config 当中和 utility 有关的配置与我们事先写好的 utility 关联起来。</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">const</span> registerToUtilities = <span class=\\\"hljs-function\\\">(<span class=\\\"hljs-params\\\">stateId, config, Component</span>) =&gt;</span> {\\n  <span class=\\\"hljs-comment\\\">// 注册到 utility 里面, 通过 check 方法判断 config 当中是否存在 utility 的配置文件</span>\\n  <span class=\\\"hljs-keyword\\\">const</span> filteredUtilities = filter(utilInstances, (_, name) =&gt; utilityDefs[name].check(config, Component))\\n  <span class=\\\"hljs-comment\\\">// 声明注册方法</span>\\n  <span class=\\\"hljs-keyword\\\">const</span> combinedUtilityRegister = concat(map(filteredUtilities, utility =&gt; utility.register || noop))\\n  <span class=\\\"hljs-comment\\\">// 下面这一行是真正注册，register 方法要求三个参数 stateId, config, Component</span>\\n  <span class=\\\"hljs-keyword\\\">const</span> cancelUtilities = concat(combinedUtilityRegister(stateId, config, Component))\\n  <span class=\\\"hljs-keyword\\\">const</span> combinedInject = compose(map(filteredUtilities, utility =&gt; loosePartial(utility.inject, stateId, config)))\\n  <span class=\\\"hljs-comment\\\">// 注册 jobs 的相关依赖</span>\\n  <span class=\\\"hljs-keyword\\\">const</span> cancelJobs = jobs.register(stateId, config, Component)\\n <span class=\\\"hljs-comment\\\">// 返回值提供清理相关监听事件的方法</span>\\n <span class=\\\"hljs-keyword\\\">const</span> cancel = concat([cancelUtilities, cancelJobs])\\n  <span class=\\\"hljs-keyword\\\">return</span> { cancel, <span class=\\\"hljs-attr\\\">inject</span>: combinedInject, cancelJobs }\\n}\\n</code></pre>\\n<p>注意 utilInstances 是经过 initialize 过的实例，jobs 是通过 createBackgroundJobContainer 得到</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">const</span> jobs = createBackgroundJobContainer(jobsDefs, utilInstances, stateTree, appearance)\\n</code></pre>\\n<p>demo 当中作者提供了 3 个 utilities 以及 2 个 jobs</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-comment\\\">// ./pages/form/index.js</span>\\n&lt;Render\\n  stateTree={stateTree}\\n  appearance={appearance}\\n  background={{\\n    <span class=\\\"hljs-attr\\\">utilities</span>: {\\n      <span class=\\\"hljs-attr\\\">validation</span>: validationBackground,\\n      <span class=\\\"hljs-attr\\\">stateTree</span>: stateTreeBackground,\\n      <span class=\\\"hljs-attr\\\">appearance</span>: appearanceBackground,\\n    },\\n    <span class=\\\"hljs-attr\\\">jobs</span>: {\\n      <span class=\\\"hljs-attr\\\">mapBackgroundToState</span>: mapBackgroundToStateJob,\\n      <span class=\\\"hljs-attr\\\">visible</span>: visibleJob,\\n    }\\n  }}\\n&gt;\\n</code></pre>\\n<p>我们先看文档结构\\n<img src=\\\"https://private-alipayobjects.alipay.com/alipay-rmsdeploy-image/skylark/png/18015/eb2947aad9af4ac1.png\\\" alt=\\\"Screen Shot 2017-05-23 at 7.49.55 PM.png\\\"></p>\\n<p>background 文件夹下有2个文件夹，分别对应了 job 和 utility, 其中 job 下有mapBackgroundToState.js、visibility.js，utility 下有 validation/index.js、appearance.js 还有 stateTree.js。</p>\\n<p>先观察 job 下的2个文件（这里不展开），分别接受 utilInstances、stateTree、appearance(optional) 三个参数，initialize 后返回3个方法 register、run、handle。\\n以 mapBackgroundToState.js 为例，</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-comment\\\">/* 把用户定义的 mapBackgroundToState 和 stateId 捆绑，其中\\n * mapBackgroundToState 是一个函数数组\\n */</span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">register</span>(<span class=\\\"hljs-params\\\">stateId, {mapBackgroundToState=[]}</span>) </span>{\\n  stateIdToMapFns[stateId] = mapBackgroundToState\\n}\\n\\n<span class=\\\"hljs-comment\\\">/* 用来执行用户定义在 mapBackgroundToState 的函数数组\\n * 其中 utilInstances 的传入，是因为 mapBackgroundToState \\n * 当中的函数可能会依赖到 utility，比如 visible 的显影规则可能\\n * 要依赖于 validation，也就是说 job 下的监听方法和 state 还有 \\n * utility 存在依赖关系\\n */</span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">run</span>(<span class=\\\"hljs-params\\\">stateId</span>) </span>{\\n  <span class=\\\"hljs-keyword\\\">const</span> state = stateTree.getById(stateId)\\n  <span class=\\\"hljs-keyword\\\">const</span> statePath = state._getStatePath()\\n  <span class=\\\"hljs-keyword\\\">const</span> injectedFns = stateIdToMapFns[stateId].map(\\n    <span class=\\\"hljs-function\\\"><span class=\\\"hljs-params\\\">mapFn</span> =&gt;</span> arg =&gt; ({\\n      ...utilInstances,\\n      state,\\n      statePath,\\n      <span class=\\\"hljs-attr\\\">nextState</span>: { ...arg.nextState, ...mapFn(arg) }\\n    })\\n  )\\n  <span class=\\\"hljs-keyword\\\">return</span> compose(injectedFns)({ ...utilInstances, <span class=\\\"hljs-attr\\\">nextState</span>: {} }).nextState\\n}\\n\\n<span class=\\\"hljs-comment\\\">// 更新 stateTree</span>\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">handle</span>(<span class=\\\"hljs-params\\\">stateId, result</span>) </span>{\\n  stateTree.mergeById(stateId, result)\\n}\\n\\n</code></pre>\\n<p>回到 ./pages/form/index.js，可以观察到有一段代码很好的说明了 mapBackgroundToState 怎么使用的。</p>\\n<pre class=\\\"hljs\\\"><code>&lt;C.Button initialState={{<span class=\\\"hljs-attr\\\">text</span>: <span class=\\\"hljs-string\\\">'弱校验'</span>, <span class=\\\"hljs-attr\\\">type</span>: <span class=\\\"hljs-string\\\">'primary'</span>, <span class=\\\"hljs-attr\\\">disabled</span>: <span class=\\\"hljs-literal\\\">false</span>}} mapBackgroundToState={[looseValidation]} /&gt;\\n<span class=\\\"hljs-function\\\"><span class=\\\"hljs-keyword\\\">function</span> <span class=\\\"hljs-title\\\">looseValidation</span>(<span class=\\\"hljs-params\\\">{validation}</span>)</span>{\\n  <span class=\\\"hljs-keyword\\\">const</span> isValid = validation.isValid(<span class=\\\"hljs-string\\\">''</span>, <span class=\\\"hljs-literal\\\">true</span>)\\n  <span class=\\\"hljs-keyword\\\">return</span> {<span class=\\\"hljs-attr\\\">disabled</span>: !isValid}\\n}\\n\\n</code></pre>\\n<p>job 的代码结构说完了，我们再看 utility 的结构是如何定义的？观察 validation/index.js、appearance.js、stateTree.js 发现，同 job 的文件结构类似，每个 utility 文件都 export 2个方法 initialize() 和 check()，initialize() 用来本地初始化相关变量，之后返回 collect()、extractor()、once() 至少这三个方法，像 validation/index.js 还会返回 register() 方法用来收集依赖，将 stateId 和 validation 方法关联起来。collect()、extractor()、once() 来自 createStatePathCollector.js</p>\\n\"}",
	"开始之前": "{\"title\":\"开始之前\",\"description\":\"基础教程\",\"author\":\"imink\",\"index\":[0,1],\"group\":\"QUICK START\",\"url\":\"开始之前\",\"toc\":[{\"id\":\"react-redux-yi3-ji2-mobx\",\"value\":\"React, Redux 以及 Mobx\"},{\"id\":\"jsx-yu3-fa3\",\"value\":\"JSX 语法 \\b\"},{\"id\":\"es6-yu3-fa3\",\"value\":\"ES6 语法\"}],\"content\":\"<h1 id=\\\"kai1-shi3-zhi1-qian2\\\">开始之前</h1>\\n<h2 id=\\\"react-redux-yi3-ji2-mobx\\\">React, Redux 以及 Mobx</h2>\\n<p>在正式使用 Cicada 之前，我们建议你已经掌握了 React 的基本用法，包括组件的写法，state 和 props 的概念。\\n对于 Redux，我们希望你已经了解单向数据流的概念，以及全局 state tree 的优势和好处\\n对于 Mobx，我们希望你知道观察者模式的用法。</p>\\n<h2 id=\\\"jsx-yu3-fa3\\\">JSX 语法 \\b</h2>\\n<p>JSX 是 React 提出的一种基于 JavaScript 的语法，它能够混写 JS 和 HTML，\\b灵活方便的实现一些复杂的页面结构。</p>\\n<h2 id=\\\"es6-yu3-fa3\\\">ES6 语法</h2>\\n\"}",
	"项目开始": "{\"title\":\"项目开始\",\"description\":\"基础教程\",\"author\":\"imink\",\"index\":[0,2],\"group\":\"QUICK START\",\"url\":\"项目开始\",\"toc\":[{\"id\":\"xie3-yi1-ge4-hello-word-cheng2-xu4\",\"value\":\"写一个 Hello Word 程序\"},{\"id\":\"wo3-men2-yin3-ru4-liao3-na3-xie1-bian4-liang2-ta1-men2-fen1-bie2-you3-shi2-mo2-zuo4-yong4\",\"value\":\"\\b我们引入了哪些变量，他们分别有什么作用\"},{\"id\":\"shi2-mo2-shi4-react-lego-zu3-jian4-gui1-fan4\",\"value\":\"什么是 React Lego 组件规范\"},{\"id\":\"liao3-jie3-geng1-duo1\",\"value\":\"\\b了解更多\"}],\"content\":\"<h2 id=\\\"xie3-yi1-ge4-hello-word-cheng2-xu4\\\">写一个 Hello Word 程序</h2>\\n<p>在安装完 cicada 之后，\\b我们可以通过一个 \\b\\bHello World 程序，来认识一下常用的代码结构。因为 cicada 构建在 React 之上，我们完全可以按照 React 的方式来写 Hello Word 程序。</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">import</span> ReactDom form <span class=\\\"hljs-string\\\">'react-dom'</span>\\nReactDOM.render( <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">div</span>&gt;</span>Hello World!<span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">div</span>&gt;</span></span>, <span class=\\\"hljs-built_in\\\">document</span>.getElementById(<span class=\\\"hljs-string\\\">'root'</span>))\\n</code></pre>\\n<p>没错，这可以说是最简单的 React 用法了。接下来我们把 Cicada  的相关依赖导入，认识一下标准的 Cicada 程序写法。</p>\\n<pre class=\\\"hljs\\\"><code><span class=\\\"hljs-keyword\\\">import</span> React <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'react'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> ReactDOM <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'react-dom'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> connect <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/connect'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> { mapValues } <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/util'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> Render <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/Render'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> createStateTree <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/createStateTree'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> createAppearance <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/createAppearance'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> createBackground <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/createBackground'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> applyStateTreeSubscriber <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/applyStateTreeSubscriber'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> * <span class=\\\"hljs-keyword\\\">as</span> validationBackground <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/background/utility/validation'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> * <span class=\\\"hljs-keyword\\\">as</span> stateTreeBackground <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/background/utility/stateTree'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> * <span class=\\\"hljs-keyword\\\">as</span> appearanceBackground <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/background/utility/appearance'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> * <span class=\\\"hljs-keyword\\\">as</span> mapBackgroundToStateJob <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/background/job/mapBackgroundToState'</span>\\n<span class=\\\"hljs-keyword\\\">import</span> * <span class=\\\"hljs-keyword\\\">as</span> visibleJob <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'@cicada/render/lib/background/job/visibility'</span>\\n\\n<span class=\\\"hljs-keyword\\\">import</span> * <span class=\\\"hljs-keyword\\\">as</span> Demo <span class=\\\"hljs-keyword\\\">from</span> <span class=\\\"hljs-string\\\">'./Demo'</span>\\n\\n\\n<span class=\\\"hljs-keyword\\\">const</span> C = mapValues({ Demo }, connect)\\n<span class=\\\"hljs-keyword\\\">const</span> stateTree = applyStateTreeSubscriber(createStateTree)()\\n<span class=\\\"hljs-keyword\\\">const</span> appearance = createAppearance()\\n<span class=\\\"hljs-keyword\\\">const</span> background = createBackground()\\n\\n<span class=\\\"hljs-built_in\\\">window</span>.stateTree = stateTree\\nReactDOM.render(\\n  <span class=\\\"xml\\\"><span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">Render</span>\\n    <span class=\\\"hljs-attr\\\">stateTree</span>=<span class=\\\"hljs-string\\\">{stateTree}</span>\\n    <span class=\\\"hljs-attr\\\">appearance</span>=<span class=\\\"hljs-string\\\">{appearance}</span>\\n    <span class=\\\"hljs-attr\\\">background</span>=<span class=\\\"hljs-string\\\">{background}</span>\\n  &gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;<span class=\\\"hljs-name\\\">C.Demo</span> &gt;</span> Hello World <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">C.Demo</span>&gt;</span>\\n  <span class=\\\"hljs-tag\\\">&lt;/<span class=\\\"hljs-name\\\">Render</span>&gt;</span>,\\n  document.getElementById('mount'),\\n)\\n</span></code></pre>\\n<div id=\\\"demo-1\\\">这里挂载 snippet playground</div>\\n<p>代码变多了起来是不是？当然，Cicada 本身不是用来处理的简单的页面渲染，我们在组件的基础之上，通过 Cicada 引擎赋予了组件更多的能力，\\b通过组件本身暴露的状态的事件，让用户实现更多复杂的效果和需求。</p>\\n<h2 id=\\\"wo3-men2-yin3-ru4-liao3-na3-xie1-bian4-liang2-ta1-men2-fen1-bie2-you3-shi2-mo2-zuo4-yong4\\\">\\b我们引入了哪些变量，他们分别有什么作用</h2>\\n<h2 id=\\\"shi2-mo2-shi4-react-lego-zu3-jian4-gui1-fan4\\\">什么是 React Lego 组件规范</h2>\\n<h2 id=\\\"liao3-jie3-geng1-duo1\\\">\\b了解更多</h2>\\n\"}",
	"安装 Cicada": "{\"title\":\"安装 Cicada\",\"description\":\"基础教程\",\"author\":\"imink\",\"index\":[0,3],\"group\":\"QUICK START\",\"url\":\"安装-cicada\",\"toc\":[],\"content\":\"<p>\\b安装之前确保系统已经安装了最新的 Node.js 以及 NPM，如果你还没有安装，请前往<a href=\\\"\\\">这里</a>。</p>\\n<p>接下来，</p>\\n<p><code>npm install --save @cicada/render</code></p>\\n<p>安装核心的引擎模块。你就可以写一些简单的程序了。因为 Cicada 应用于\\b React Lego 组件，你可以来<a href=\\\"\\\">这里</a> 找到我们提供的 antd UI 组件，或者也可以按照 <a href=\\\"\\\">React Lego 规范</a> 来根据需求编写组件。</p>\\n<p>在 example 文件夹当中，我们提供了常见的 demo（其中包含了常见的场景，比如表单验证和路由\\b用法）方便快速上手。</p>\\n\"}"
};

